element.documentation:
The Operational Settings business object includes the schedule for:
• device status (switch status, tap position, shunt bank position);
• control settings (voltage regulation, flow regulation); 
• monitoring (operational limit determination, critical grid elements, topology limitation (power transfer corridors) and stability limits.

The Availability Request Management (ARM) business function involved the management of request for making grid elements available or unavailable for the network operation. This includes, but is not limited to, requesting for: 

• taking a grid element out-of-service for maintenance or other work; 
• setting a grid element in-to-service after work or new construction; 
• coordination with other entities that have system responsibility and would be affected by the change of availability; 
• coordinating with the Work Management to establish a schedule for the availability; 
• coordinating with Market Operation to inform the market or to minimise the impact to the market; 
• inform relevant entities about forced unavailability or customer outage; 
• coordinating the resolution of forced unavailability or customer outage planned and schedule.

Different scheduling alternatives might be created to evaluate their impact on the transfer capacity and the operational security of the grid.

This State Evaluation business function includes all activity that evaluates the current state of the grid. In general, this involves analytical processes that use acquired data and network models as input, and that generate evaluations of the grid from varying perspectives, such as:

- topology analysis, feeder tracing, island detection
- state estimation;
- contingency analysis;
- dynamic stability analysis;
- alarms;
- reserve calculations;
- dynamic limit calculations

The Real-Time Data Acquisition (RTDA) business function includes the collection and validation of measurements and observations that are used to determent the present state of the system that is under the entities' control. This could include acquisition of measurements and observations that are outside the entity's responsibility, but where the equipment that is defined as relevant to determine the state of the responsible system. The measurements and observations could include:
- traditional SCADA points and analogues;
- manually collected and entered data;
- phasor data;
- data generated by other systems, such as:
-- generating plants;
-- EC 61850 systems;
-- lower or higher-level operations' activities.

The common denominator for this data is that it is sampled data treated as raw input, as opposed to a setting or instruction or request received from some other system. In other words, the source of the data is completely ignorant of the acquisition and use of the data. It is not a coordinated integration of peer intelligence.

The Real-Time Measurement business object includes measurements from any source. Examples include:
– RTU;
– PMU; 
– ICCP; 
– AMI; 
– smart devices; 
– protection; 
– IEC 61850

The Frequency Restoration Reserve business object is a specialisation of Market Result that describes:
• aFRR – automatic frequency restoration reserve; 
• mFRR – manual frequency restoration reserve; 
• frequency containment reserve –
nFCR – normal situation; 
• dFCR – frequency containment reserve – disturbed situation

The State Assessment business object includes:

• alarms to indicate system failure and response required;
• load estimation calculated on a more granular basis than load forecasts, based on specified conditions, weather and other events;
• load flow/voltage profile of operating conditions and voltage problems;

the network by predicting and analysing preventing
• protective relay setting that can be adjusted based on conditions such as weather and operational conditions;
• protective relay analysis to coordinate protective schemes such as opening a breaker after a high current is detected;
• weather data to predict impacts on the electrical networks, especially where outages are likely to occur due to heavy storm activity. Temperature and wind speed are sometimes used to calculate dynamic load limits on electrical network assets.

The Energy Scheduling business function involves the establishment and commitment to a given energy schedule for consumption, production, direct current and area inter- exchange. 

This also includes energy scheduling for intermittent or price inelastic production that is part of Distributed Energy Resources (DER).
The Energy Scheduling (ES) business function is: 
• involved in optimising production; 
• cost based; 
• involved in schedule-marked energy purchases /agreements; 
• season based; 
• involved in predictive analysis based on historical logs;
• involved in the establishment of the most realistic energy forecast possible with relevant uncertainty.

Power import scheduling and optimisation aims to minimise the cost of imported power by keeping the average imported power close to the contracted value, making use of peak plants, load switching or load shedding. This business function includes scheduled energy quantities, such as:
• market outcomes; 
• unit schedules; 
• net or bilateral interchange schedules; 
• direct current tie schedules; 
• phase-shifter schedules

The End Device Acquisition (EDA) business function includes all activities that gather non-real-time data from an end device, e.g. a meter, Phasor Measurement Unit (PMU), or fault recorder. 

This includes data such as: 
– analogue data such as meter reading;
– discrete data such as on and off
– status; 
– control results.

The Environment Forecast business object includes the estimation of the intensity, nature, and timing of the external forces that may affect the performance of individual assets in the grid or the grid as a whole. This includes forecast or hindcast on:
• space (solar flares); 
• atmospheric conditions (wind speed gust, humidity etc.); 
• geospheric conditions (fire, earthquake etc.); 
• hydrospheric conditions (flood level, water temperature, surface temperature etc.

